import logo from "./image1.png";
import "./App.css";
function App() {
  return (
    <div className="centeredBlock">
      <h1>
        Hi!<br></br>
      </h1>
      <p>
        <br></br>
      </p>
      <img src={logo} className="centeredImage"></img>
    </div>
  );
}

export default App;
